def gen_all_icon(path):
    import os, base64, json
    _all_data = {}
    for i in os.listdir(path):
        _file = os.path.join(path, i)
        _, filename = os.path.split(_file)
        filename_nofix, _ = os.path.splitext(filename)
        _, pofix = os.path.splitext(_file)
        if pofix.lower() in ('.png', '.jpg', '.jpeg', '.gif'):
            with open(_file, "rb") as f:
                base64_data = str(base64.b64encode(f.read()), encoding='utf-8')
            _all_data[filename] = (base64_data, pofix.upper().strip('.'))
    with open('dt.json', 'w') as f:
        f.write(json.dumps(_all_data))
    return _all_data


