class IconHandle(object):
    def __init__(self):
        self.loaddata()

    def getAllFileName(self):
        for k, v in self.data_base.items():
            yield k

    def getIconByName(self, name):
        import base64
        from PyQt5.QtGui import QPixmap
        if name not in self.data_base:
            return
        data = self.data_base.get(name)[0]
        pngData = base64.b64decode(data)
        pix = QPixmap()
        pix.loadFromData(pngData)
        return pix

